script: |
  super -f text -I q2466.spq | sort > q2466.out

inputs:
  - name: q2466.spq
    data: |
      SELECT DISTINCT + ( - col2 ) AS col0 FROM tab2 (FORMAT parquet) WHERE - col1 NOT IN ( 8, + col2, 53 + + + 29 + + - col2 * + CAST ( - + col0 AS INTEGER ) );
  - name: tab2

outputs:
  - name: q2466.out
    data: |
      -23
      -40
      -58
